    const {coin}=props
    const price='$'+String.toString(coin.current_price)
    return(
        <tr>
            <td>{coin.name}</td>
            <td>{price}</td>
            <td>{coin.total_volume}</td>
            <td>{coin.market_cap}</td>
        </tr>
    )
}
export default Coin
